import React from 'react'
import Dealer from '../components/profile/Dealer'

const MyProfile = () => {
    return (
        <div className='pl-[20%] h-full py-12'>
            <div className='max-w-[90%] mx-auto w-full'>
                <Dealer />
                <form action="">
                    {/* Profile setting */}
                    <div>
                        <h2 className='text-[26px] pl-2 mb-[25px] border-l-2 border-[#d01818]'>Become Dealer</h2>
                        <div class="flex mb-[70px] gap-[90px]">
                            <h3 className='text-[#1C1818] text-[21px] font-semibold'>Avatar:</h3>
                            <div class="avatar">
                                <div class="max-w-[158px] w-full mb-3">
                                    <img loading="lazy" height="138" className='w-full rounded-[8px]' src="" alt="avatar" />
                                </div>
                                <div class="choose-box">
                                    <p className='text-[#433D3D] text-[18px] mb-3'>Upload a new Avatar</p>
                                    <div class="mb-5 rounded-[5px] border border-[#CECECE] bg-transparent m-0 text-sm py-4 px-6">
                                        <input type="file" hidden="" class="form-control" id="tfcl_avatar" name="profile_image"/>
                                        <label htmlFor='upload' className='rounded-[6px] bg-white text-md py-[6px] px-4    border-radius: 6px;
    background: #FFF;
    color: var(--theme-primary-color);
    position: absolute;
    top: 50%;
    left: 10px;
    transform: translateY(-50%);
    color: #000;
    font-size: 16px;
    font-weight: 500;
    text-transform: capitalize;
    padding: 6px 15px;
    padding-right: 28px;'><i class="fas fa-cloud-upload-alt"></i> Choose File</label>
                                        <span></span>
                                    </div>
                                    <span class="notify-avatar">PNG, JPG, SVG dimension (400 * 400) max file not more then size 4 mb</span>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* User information */}

                </form>
            </div>
        </div>
    )
}

export default MyProfile
